import React, { Component } from 'react';
import { Image } from 'react-bootstrap';
import {Container} from 'react-bootstrap';
import {Navbar} from 'react-bootstrap';
import reloj from './reloj';
import { BsReception4 } from "react-icons/bs";

 class NavBa extends Component {
  render() {
    return (
        <Navbar>
        <Container>
          <Navbar.Brand href="#home">{reloj}</Navbar.Brand>
          <Navbar.Toggle />
          <Navbar.Collapse className="justify-content-end">
            <Navbar.Text>
             <Image src="https://t4.ftcdn.net/jpg/01/53/55/09/240_F_153550996_KrY2fKkQh4dHCnU4WuTTDRg2QZfDdwDo.jpg" alt=""/>
             <Image src='/Imagenes/general/Battery.png' alt="Bater" />
             <Image src= {<BsReception4/>} alt="Bater" />
            </Navbar.Text>
          </Navbar.Collapse>
        </Container>
      </Navbar>
    )
  }
}
export default NavBa;
